import './App.css';
import Header from './components/header';
import AddTimeTable from './components/addtimetable';
import {BrowserRouter as Router,Route} from 'react-router-dom'

function App() {
  return (
    <div>
      <Header/>
      <Route path ='/add' exact component = {AddTimeTable}></Route>
    </div>
  );
}

export default App;
